import React from 'react';
import { useNavigate } from 'react-router-dom';

function Dashboard() {
  const navigate = useNavigate();

  return (
    <div style={{ padding: '2rem' }}>
      <h2>Welcome to Complaint Tracker Dashboard</h2>

      <div style={styles.buttonRow}>
        <button onClick={() => navigate('/pages/RegisterComplaint')}>üìù Register Complaint</button>
        <button onClick={() => navigate('/volunteer')}>ü§ù Become Volunteer</button>
        <button onClick={() => navigate('/active-complaints')}>üü† Active Complaints</button>
        <button onClick={() => navigate('/solved-complaints')}>‚úÖ Solved Complaints</button>
      </div>
    </div>
  );
}

const styles = {
  buttonRow: {
    display: 'flex',
    gap: '1rem',
    flexWrap: 'wrap',
    marginTop: '1rem',
    marginBottom: '1rem'
  }
};

export default Dashboard;
